import React from 'react';
import styled from 'styled-components';
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 200vh;
  width: 100vw;

  .car-info-wrapper {
    position: relative;
    height: 100vh;
    width: 100vw;
  }
  .sticky-trigger-1 {
    position: absolute;
    bottom: 0;
  }
`;

function SlideTwo() {
  return (
      <StyledSlideTwo>
        <div className='car-info-wrapper'>
          <CarInfoDisplay />
          <div className='sticky-trigger-1' />
        </div>
      </StyledSlideTwo>
  );
}

export default SlideTwo;
